import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <h1>Calculate Fibonnaci!</h1>
          <form>
            <input type="text" id="txtValue" name="txtValue"></input>
          </form>
          <button onclick="callApi()">Calculate</button>
          <label for="">Fibonnaci Result: </label>
          <label id="lblResult" for=""></label>
        </p>
      </header>
    </div>
  );
}

export default App;
